def get_sol(x,y): return Robot(x,y)
class Robot:
    def __init__(self, width: int, height: int):
        self.di = {0:(1,0),1:(0,1),2:(-1,0),3:(0,-1)}
        self.dir_names = {0:'East',1:'North',2:'West',3:'South'}
        self.h=height
        self.w =width
        self.dir=3
        self.pos=0
        self.first=True
    def step(self, num: int) -> None:
        self.pos+=num
        perimeter= 2*(self.h+self.w)-4
        self.pos%=perimeter
        self.first=False
    def getPos(self) -> List[int]:
        left=self.pos

        x=min(left,self.w-1)
        left-=x
        if not left: return [x,0]

        y=min(left,self.h-1)
        left-=y
        if not left: return [x,y]

        x-=min(left,self.w-1)
        left-=min(left,self.w-1)
        if not left: return [x,y]

        y-=left
        return [x,y]
    def getDir(self) -> str:
        x,y=self.getPos()
        if x==0 and y==0 and self.first:
            return 'East'
        if x==0 and y==0: return 'South'
        if y==0: return 'East'
        if x==self.w-1: return 'North'
        if y==self.h-1: return 'West'
        return 'South'

class tester(unittest.TestCase):
    def do_test(self,commands, inputs):
        outputs = []
        obj = ""
        for i,cmd,input in zip(range(len(inputs)),commands,inputs):
            if cmd=='Robot':
                obj = get_sol(input[0],input[1])
                outputs.append(None)
            elif cmd=='step':
                outputs.append(obj.step(input[0]))
            elif cmd=='getPos':
                outputs.append(obj.getPos())
            elif cmd=='getDir':
                outputs.append(obj.getDir())
        return outputs
